const  JM = ()=>{

    let obj = {
        table:[]
    };
    const xslx = require('xlsx');
    const filePath = process.argv.slice(2)[0];
    const workbook = xslx.readFile(filePath);

    const sheet = workbook.Sheets[workbook.SheetNames[0]];

    const posts = [];
